import React from 'react';

import { Container, MenuItem, MenuContainer } from './FilterMenu.styles';



const FilterMenu = () => (
  <Container>
    <MenuContainer>
      Filter by: <MenuItem>Certificate</MenuItem> |
      <MenuItem>Associates</MenuItem> |
      <MenuItem>Bachlores</MenuItem>
    </MenuContainer>
    <MenuContainer>
      Sort by: <MenuItem>Program Name</MenuItem> |
      <MenuItem>Degree Type</MenuItem> |
      <MenuItem>Tuition</MenuItem>
    </MenuContainer>
  </Container>
);

export default FilterMenu;
